import { useState } from "react"

function Home() {

    const [ number, setNumber ] = useState(1);

    let onClick = (_) => {
        setNumber(number + 1);
    }

    return (
        <div style={{textAlign: 'center'}}>
            <button onClick={onClick}>
                Actuel : {number}
            </button>

            <br />
            <p>
                Ouais bon... j'avais pas d'id√©e...
            </p>
        </div>
    )

}

export default Home;
